.searchIndex {
    padding: 20px 0 0 20px;
    height: 100%;
    width: 100%;
    ::v-deep .el-tabs {
        height: 100%;
        .el-tabs__header {
            margin: 0;
            .el-tabs__nav-scroll {
                .el-tabs__nav {
                    .el-tabs__active-bar {
                        background-color: transparent;
                    }
                    .el-tabs__item {
                        margin-right: 8px;
                        background: #84C22E;
                        color: #fff;
                        border-radius: 4px;
                        padding: 0 20px !important;
                    }
                    .is-active {
                        color: #000;
                        background: #79ac43;
                    }
                }
            }
            .el-tabs__nav-wrap::after {
                background-color: transparent;
            }
        }
    }
}
